import React from "react";
const downloadIcon = require("./../assets/images/flags/select2");

interface IProps {
  url: string;
}

const FileMessage: React.FC<IProps> = ({ url }) => {
  return <div className="ct-d-flex ct-flex-nowrap">
  <div className="ct-bubble ct-d-flex ct-flex-nowrap">
    <img alt="" src={require("./../assets/images/flags/select2/ak.png")} />
    <span className="ct-d-inline-block ct-ml-2">
      <div className="ct-message">{url}</div>
    </span>
  </div>
  <span className="ct-pointer" style={{}}>
    <a href={url} download target="_blank">
      <img alt="" src={require("./../assets/images/flags/select2/ak")} />
    </a>
  </span>
</div>
};

export default FileMessage;
